VALUES ('6400712018203', 'cheese Burger', 'burger 50% [viande de porc (partiellement hachée finement) 80%, chapelure (farine de blé, eau, sel, levure), eau, oignon, sel, épices (moutarde), huile de tournesol, dextrose, amidon de blé, moutarde (eau, graine de moutarde, vinaigre d\'alcool, sel, sucre, épices), ceufl, petit pain au sésame 34,5% [farine de blé, eau, sucre, huile de colza, levure, sel, graine de sésame, levain de blé (farine de blé eau)], préparation au fromage fondu 9,5% (fromage, eau, beurre, protéines de lait,émulsifiants (E331, E339), lait écrémé en poudre, arôme naturel de fromage, sel, correcteur d acidité (E270), colorants (E160a, E160c), anti-agglomérant (E322)], ketchup 6% (purée de tomates 71%, sirop de glucose-fructose, sucre, vinaigre d\'alcool, sel, arôme naturel). Bevat: gluten, ei, melk, mosterd, sesam. Contient: gluten, ceuf lait, moutarde, sésame. Bereiding: verwijder de folie en het schaaltje. Microgolfoven: verwarm gedurende 1 minuut bij 600W. Traditionele oven: verwarm gedurende 10 minuten in een op 160°C voorverwarmde oven./ Préparation: enlevez le film et la barquette. Four à micro-ondes: réchauffez pendant 1 minute à 600W. Four traditionnel: réchauffez pendant 10 minutes dans un four préchauffé à 160 °C Gemiddelde voedingswaarde per/Valeur nutritive moyenne par 100g: Energie: 1266kJ/', 'https://static.openfoodfacts.org/images/products/640/071/201/8203/front_fr.9.400.jpg', '', '', '', '', '', '', '', '', '', '0');

